import numpy as np

#helper function for removing tricky terms 
def removeBadTerms(s):
    return s.replace("Ft.", "").replace(" Featuring", "").replace(",", "").replace("&", "")

def getBestGenre(genres):
    if not genres:
        return ""

    #will bundle up some of these genres based on overlap
    basicGenres = ["pop", "hip hop", "r&b", "rap", "rock", "metal", "electronic", "jazz", "blues", "bass", "dance"]

    for genre in genres:
        for basicGenre in basicGenres:

            if basicGenre in genre:
                
                if basicGenre == "rap":
                    return "hip hop"
                elif basicGenre == "metal":
                    return "rock"
                elif basicGenre == "jazz":
                    return "blues"
                elif basicGenre == "dance" or basicGenre == "bass":
                    return "electronic"
                else:
                    return basicGenre
    return ""

